function SummaryParty({ reference }) {
  return (
    <div className="bg-violet-200 mt-5 p-3 flex-row">
      <div className="text-2xl text-black font-semibold">About {reference.name}...</div>
      <div className="space-x-3">
        <span>Size: {reference.size}</span>
        <span>Phone: {reference.phoneNumber}</span>
        <span>Time: {reference.quotedTime}</span>
      </div>
    </div>
  );
}

export default SummaryParty;
